import React, { Component } from "react";

export default class CreateHabit extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      duration: 0,
      datesCompleted: [],
      users: [],
    };
  }

  onChange(e) {
    this.setState({
      [e.target.name]: e.target.value,
    });
  }

  render() {
    return <p>This is the create habit component </p>;
  }
}
